import React from 'react'

const Cards = (props) => {
  let courses=props.courses;
  function getCourses() {
    let allCourses=[];
    Object.values(courses).forEach(array=>{
      array.forEach(courseData=>{
        allCourses.push(courseData);
      })
    })
    return allCourses;
  }
  return (
    <div>Cards</div>
  )
}

export default Cards
